import Vue from 'vue';
import VueRouter from 'vue-router';
import Home from '../views/home';
import Login from '../views/login';
import Redirect from '../views/redirect';
import config from '../config/index';
import store from '../store';

const serverType = 'simsbff';

Vue.use(VueRouter);

// 布局框架
import Layout from '../views/layout';
import { FORM_OPERATION_TYPE } from '../shared/constant';

/**
 * Note: sub-menu only appear when route children.length >= 1
 * Detail see: https://panjiachen.github.io/vue-element-admin-site/guide/essentials/router-and-nav.html
 *
 * hidden: true                   if set true, item will not show in the sidebar(default is false)
 * alwaysShow: true               if set true, will always show the root menu
 *                                if not set alwaysShow, when item has more than one children route,
 *                                it will becomes nested mode, otherwise not show the root menu
 * redirect: noRedirect           if set noRedirect will no redirect in the breadcrumb
 * name:'router-name'             the name is used by <keep-alive> (must set!!!)
 * meta : {
    roles: ['admin','editor']    control the page roles (you can set multiple roles)
    title: 'title'               the name show in sidebar and breadcrumb (recommend set)
    icon: 'svg-name'/'el-icon-x' the icon show in the sidebar
    noCache: true                if set true, the page will no be cached(default is false)
    affix: true                  if set true, the tag will affix in the tags-view
    breadcrumb: false            if set false, the item will hidden in breadcrumb(default is true)
    activeMenu: '/example/list'  if set path, the sidebar will highlight the path you set
  }
 */

export const routes = [
  {
    path: '/redirect',
    component: Layout,
    hidden: true,
    children: [
      {
        path: '/redirect/:path(.*)',
        component: Redirect
      }
    ]
  },
  {
    path: '/login',
    name: 'Login',
    component: Login,
    meta: {
      title: '跳转登录中'
    },
    hidden: true
  },
  {
    path: '/sso/auth',
    redirect: '/home',
    hidden: true
  },
  {
    path: '/',
    name: 'Layout',
    redirect: '/home',
    component: Layout,
    children: [
      {
        path: '/home',
        name: 'Dashboard',
        component: Home,
        meta: { title: '首页', icon: 'dashboard' }
      }
    ]
  },
  {
    path: '/public',
    name: 'Layout',
    component: Layout,
    meta: {
      title: '公共页面',
      breadcrumb: false
    },
    children: [
      {
        path: '/business/register-detail',
        name: 'RegisterDetail',
        meta: {
          title: '报名订单详情',
          noCache: true,
          public: true
        },
        hidden: true,
        props: route => ({
          orderNo: route.query.orderNo
        }),
        component: () =>
          import(
            /* webpackChunkName: "sims-register-detail" */ '../views/business/RegisterDetail/index'
          )
      },
      {
        path: '/business/upgrade-detail',
        name: 'UpgradeDetail',
        meta: {
          title: '升级订单详情',
          noCache: true,
          public: true
        },
        props: route => ({
          orderNo: route.query.orderNo
        }),
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-upgrade-detail" */ '../views/business/UpgradeDetail/index'
          )
      },
      {
        path: '/business/choose-detail',
        name: 'ChooseDetail',
        meta: {
          title: '择升订单详情',
          noCache: true,
          public: true
        },
        props: route => ({
          orderNo: route.query.orderNo
        }),
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-choose-detail" */ '../views/business/ChooseDetail/index'
          )
      },
      {
        path: '/business/change-division-detail',
        name: 'ChangeDivisionDetail',
        meta: {
          title: '内转订单详情',
          noCache: true,
          public: true
        },
        props: route => ({
          orderNo: route.query.orderNo
        }),
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-change-division-detail" */ '../views/business/ChangeDivisionDetail/index'
          )
      },
      {
        path: '/business/order-change-no-fee',
        name: 'OrderChangeNoFee',
        meta: {
          title: '订单变更(不涉及费用)',
          noCache: true,
          public: true
        },
        props: route => ({
          enrollCode: route.query.enrollCode,
          signYearType: route.query.signYearType,
          sourceType: route.query.sourceType,
          sno: route.query.sno,
          isSettle: Boolean(route.query.isSettle),
          orderType: route.query.orderType,
          orderNo: route.query.orderNo
        }),
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-order-change" */ '../views/business/OrderChangeNoFee/index'
          )
      },
      {
        path: '/business/print',
        name: 'Print',
        meta: {
          title: '打印',
          noCache: true,
          public: true
        },
        hidden: true,
        props: route => ({
          orderNo: route.query.orderNo
        }),
        component: () =>
          import(/* webpackChunkName: "sims-print" */ '../views/business/Print')
      },
      {
        path: '/process/refund-process',
        name: 'RefundProcess',
        meta: {
          title: '退费',
          public: true
        },
        props: route => ({
          operation: route.query.operation, // 操作类型
          orderNo: route.query.orderNo, // 订单编号
          stuSno: route.query.stuSno, // 学号
          signYearType: route.query.signYearType, // 学年
          flowNo: route.query.flowNo // 流程编号
        }),
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-refund-process" */ '../views/process/RefundProcess/index'
          )
      },
      {
        path: '/process/amount-ajustment-process',
        name: 'AmountAjustmentProcess',
        meta: {
          title: '定费',
          public: true
        },
        hidden: true,
        props: route => ({
          operation: route.query.operation, // 操作类型
          orderNo: route.query.orderNo, // 订单编号
          stuSno: route.query.stuSno, // 学号
          signYearType: route.query.signYearType, // 学年
          flowNo: route.query.flowNo // 流程编号
        }),
        component: () =>
          import(
            /* webpackChunkName: "sims-amount-ajustment-process" */ '../views/process/AmountAjustmentProcess/index'
          )
      },
      {
        path: '/process/shuttle-dormitory-process',
        name: 'ShuttleDormitoryProcess',
        meta: {
          title: '接送住宿',
          public: true
        },
        hidden: true,
        props: route => ({
          operation: route.query.operation, // 操作类型
          orderNo: route.query.orderNo, // 订单编号
          stuSno: route.query.stuSno, // 学号
          signYearType: route.query.signYearType, // 学年
          flowNo: route.query.flowNo, // 流程编号
          status: route.query.flowStatus // 流程状态
        }),
        component: () =>
          import(
            /* webpackChunkName: "sims-shuttle-dormitory-process" */ '../views/process/ShuttleDormitoryProcess/index'
          )
      },
      {
        path: '/process/drop-out-process',
        name: 'DropOutProcess',
        meta: {
          title: '退学流程详情',
          public: true,
          noCache: true
        },
        hidden: true,
        props: route => ({
          operation: route.query.operation, // 操作类型
          orderNo: route.query.orderNo, // 订单编号
          stuSno: route.query.stuSno, // 学号
          signYearType: route.query.signYearType, // 学年
          flowNo: route.query.flowNo // 流程编号
        }),
        component: () =>
          import(
            /* webpackChunkName: "sims-drop-out-process" */ '../views/process/DropOutProcess/index'
          )
      },
      {
        path: '/financial/payment-details',
        name: 'PaymentDetails',
        meta: {
          title: '收入明细详情',
          noCache: true,
          public: true
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-payment-details" */ '../views/financial/PaymentDetails/index'
          )
      },
      {
        path: '/financial/depart-charge-project',
        name: 'DepartChargeProject',
        meta: {
          title: '编辑收费规则',
          public: true
        },
        props: route => {
          let isEdit = route.query.isEdit === '1';
          route.meta.title = isEdit ? '编辑收费规则' : '查看收费规则';
          store.dispatch('tagsView/updateVisitedView', route);
          return {
            data: route.query,
            isEdit: isEdit
          };
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-depart-charge-project" */ '../views/financial/DepartChargeProject/index'
          )
      },
      {
        path: '/financial/depart-charge-standard',
        name: 'DepartChargeStandard',
        meta: {
          title: '编辑收费标准',
          public: true
        },
        props: route => {
          let isEdit = route.query.isEdit === '1';
          route.meta.title = isEdit ? '编辑收费标准' : '查看收费标准';
          store.dispatch('tagsView/updateVisitedView', route);
          return {
            data: route.query,
            isEdit: isEdit
          };
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-depart-charge-standard" */ '../views/financial/DepartChargeStandard/index'
          )
      },
      {
        path: '/education/student-details',
        name: 'StudentDetails',
        meta: {
          title: '报名登记',
          noCache: true,
          public: true
        },
        props: route => {
          let titleMap = {
            '1': '报名登记',
            '2': '择升登记',
            '3': '升级登记',
            '4': '内转登记'
          };
          let query = route.query;
          query.orderType = query.orderType || '1';
          query.enrollCode = query.enrollCode || ''; //默认先填入code，用于二维码自动刷新
          route.meta.title = titleMap[query.orderType];
          document.title = route.meta.title;
          store.dispatch('tagsView/updateVisitedView', route);
          return {
            query
          };
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-student-details" */ '../views/education/StudentDetails/index'
          )
      },
      {
        path: '/education/resume-study',
        name: 'ResumeStudy',
        meta: {
          title: '离校复学登记',
          public: true
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-resume-study" */ '../views/education/ResumeStudy'
          )
      },
      {
        path: '/education/student-info',
        name: 'StudentInfo',
        meta: {
          title: '学生详情',
          public: true
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-student-info" */ '../views/education/StudentInfo/index'
          )
      },
      {
        path: '/education/class-details',
        name: 'ClassDetails',
        meta: {
          title: '班级详情',
          public: true
        },
        hidden: true,
        props: route => ({
          id: route.query.id,
          classCode: route.query.classCode
        }),
        component: () =>
          import(
            /* webpackChunkName: "sims-class-details" */ '../views/education/ClassDetails/index'
          )
      },
      {
        path: '/system/role/allot-user',
        name: 'BAllotUser',
        hidden: true,
        meta: {
          title: '分配用户',
          noCache: true,
          public: true
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-allot-user" */ '@/components/business/BAllotUser'
          )
      },
      {
        path: '/system/role/menu-auth',
        name: 'BRoleAuthMenu',
        hidden: true,
        meta: {
          title: '菜单授权',
          noCache: true,
          public: true
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-role-auth-menu" */ '@/components/business/BRoleAuthMenu'
          )
      },
      {
        path: '/process/order-change-process',
        name: 'OrderChangeProcess',
        meta: {
          title: '订单变更(涉及费用)',
          noCache: true,
          public: 'true'
        },
        hidden: true,
        props: route => ({
          operation: route.query.operation, // 操作类型
          orderNo: route.query.orderNo, // 订单编号
          stuSno: route.query.stuSno, // 学号
          signYearType: route.query.signYearType, // 学年
          flowNo: route.query.flowNo // 流程编号
        }),
        component: () =>
          import(
            /* webpackChunkName: "sims-order-change-process" */ '../views/process/OrderChangeProcess/index'
          )
      },
      {
        path: '/system/help-document/detail',
        name: 'HelpDocumentDetail',
        meta: {
          title: '帮助中心-详情',
          noCache: true
        },
        props: route => {
          const query = route.query;
          const subtitle =
            {
              [FORM_OPERATION_TYPE.LOOK]: '查看',
              [FORM_OPERATION_TYPE.EDIT]: '编辑',
              [FORM_OPERATION_TYPE.NEW]: '新增'
            }[query.operation] || '';
          route.meta.title = '帮助中心-' + subtitle;
          store.dispatch('tagsView/updateVisitedView', route);
          return {
            ...query,
            query
          };
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-help-document-detail" */ '../views/system/HelpDocumentDetail'
          )
      },
      {
        path: '/system/help-document/look',
        name: 'HelpDocumentLook',
        meta: {
          title: '帮助中心-查看',
          noCache: true
        },
        props: route => {
          const query = route.query;
          return {
            ...query,
            query
          };
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-help-document-look" */ '../views/system/HelpDocumentLook'
          )
      },
      {
        path: '/system/help-document/page',
        name: 'HelpDocumentPage',
        meta: {
          title: '帮助中心-查看',
          noCache: true
        },
        props: route => {
          const query = route.query;
          return {
            ...query,
            query
          };
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-help-document-page" */ '../views/system/HelpDocumentPage'
          )
      },
      {
        path: '/system/help-document/list',
        name: 'HelpDocumentList',
        meta: {
          title: '帮助中心-列表',
          noCache: true
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-help-document-list" */ '../views/system/HelpDocumentList'
          )
      },
      {
        path: '/system/version-notice/list',
        name: 'VersionNoticeList',
        meta: {
          title: '版本公告-列表',
          noCache: true
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-version-notice-list" */ '../views/system/VersionNoticeList'
          )
      },
      {
        path: '/system/version-notice/detail',
        name: 'VersionNoticeDetail',
        meta: {
          title: '版本公告-详情'
        },
        props: route => {
          const query = route.query;
          const subtitle =
            {
              [FORM_OPERATION_TYPE.LOOK]: '查看',
              [FORM_OPERATION_TYPE.EDIT]: '编辑',
              [FORM_OPERATION_TYPE.NEW]: '新增'
            }[query.operation] || '';
          route.meta.title = '版本公告-' + subtitle;
          store.dispatch('tagsView/updateVisitedView', route);
          return {
            ...query,
            query
          };
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-version-notice-detail" */ '../views/system/VersionNoticeDetail'
          )
      },
      {
        path: '/system/version-notice/look',
        name: 'VersionNoticeLook',
        meta: {
          title: '版本公告-查看',
          noCache: true
        },
        props: route => {
          const query = route.query;
          return {
            ...query,
            query
          };
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-version-notice-look" */ '../views/system/VersionNoticeLook'
          )
      },
      {
        path: '/system/version-notice/page',
        name: 'VersionNoticePage',
        meta: {
          title: '版本公告-查看',
          noCache: true
        },
        props: route => {
          const query = route.query;
          return {
            ...query,
            query
          };
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-version-notice-page" */ '../views/system/VersionNoticePage'
          )
      },
      {
        path: '/financial/AccountConfirm/components/ConfirmIncomeList',
        name: 'ConfirmIncomeList',
        meta: {
          title: '确认收入详情',
          public: 'true'
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-confirm-income-list" */ '../views/financial/AccountConfirm/components/ConfirmIncomeList/index'
          )
      },
      {
        path: '/financial/AccountConfirm/components/WaitConsumeList',
        name: 'WaitConsumeList',
        meta: {
          title: '待分摊详情',
          public: 'true'
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-wait-consume-list" */ '../views/financial/AccountConfirm/components/WaitConsumeList/index'
          )
      },
      {
        path: '/process/shuttle-process',
        name: 'ShuttleProcess',
        meta: {
          title: '接送变更流程',
          noCache: true
        },
        props: route => route.query,
        component: () =>
          import(
            /* webpackChunkName: "sims-process-shuttle-process" */ '../views/process/ShuttleProcess'
          )
      },
      {
        path: '/process/classType-process',
        name: 'ClassTypeProcess',
        meta: {
          title: '转班型详情',
          noCache: true
        },
        props: route => route.query,
        component: () =>
          import(
            /* webpackChunkName: "sims-process-classType-process" */ '../views/process/ClassTypeProcess'
          )
      },
      {
        path: '/process/change-division-process',
        name: 'ChangeDivisionProcess',
        meta: {
          title: '内部跨校（部）转学流程详情',
          noCache: true
        },
        props: route => route.query,
        component: () =>
          import(
            /* webpackChunkName: "sims-change-division-process" */ '../views/process/ChangeDivisionProcess'
          )
      },
      {
        path: '/process/dormitory-process',
        name: 'DormitoryProcess',
        meta: {
          title: '住宿变更流程',
          noCache: true
        },
        props: route => route.query,
        component: () =>
          import(
            /* webpackChunkName: "sims-process-dormitory-process" */ '../views/process/DormitoryProcess'
          )
      },
      {
        path: '/process/refund-not-consumed-process',
        name: 'RefundNotConsumedProcess',
        meta: {
          title: '退未消耗项详情页',
          noCache: true
        },
        props: route => route.query,
        component: () =>
          import(
            /* webpackChunkName: "sims-process-refund-not-consumed-process" */ '../views/process/RefundNotConsumedProcess'
          )
      },
      {
        path: '/process/refund-over-pay-process',
        name: 'RefundOverPayProcess',
        meta: {
          title: '缴多退费详情页',
          noCache: true
        },
        props: route => route.query,
        component: () =>
          import(
            /* webpackChunkName: "sims-process-refund-over-pay-process" */ '../views/process/RefundOverPayProcess'
          )
      },
      {
        path: '/financial/expenditure-detail',
        name: 'ExpenditureDetail',
        meta: {
          title: '支出记录详情',
          noCache: true,
          public: true
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-expenditure-detail" */ '../views/financial/ExpenditureDetail/index'
          )
      },
      {
        path: '/performance/performance-detail',
        name: 'PerformanceDetail',
        meta: {
          title: '成绩录入详情',
          noCache: true,
          public: true
        },
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-expenditure-detail" */ '../views/grade/detail/index.vue'
          )
      },
      {
        path: '/student/freshmen-register',
        name: 'FreshmenRegister',
        meta: {
          title: '转入新生登记',
          noCache: true,
          public: true
        },
        props: route => ({
          signYearType: route.query.signYearType,
          stuSno: route.query.stuSno,
          orderType: route.query.orderType,
          isDisabled: !!route.query.isDisabled
        }),
        hidden: true,
        component: () =>
          import(
            /* webpackChunkName: "sims-freshmen-register" */ '../views/student/FreshmenRegister/index.vue'
          )
      }
    ]
  },
  {
    path: '/error',
    name: 'Layout',
    hidden: true,
    component: Layout,
    children: [
      {
        path: '/error/NotFound',
        name: 'NotFound',
        component: () =>
          import(
            /* webpackChunkName: "sims-not-found" */ '../views/demo/NotFound.vue'
          ),
        meta: { title: '404', icon: 'dashboard' }
      }
    ]
  }
];

// 异步加载路由
export const asyncRoutes = [
  {
    path: '/student',
    name: 'Student',
    redirect: '/student/pre-student-list',
    meta: {
      title: '学生管理',
      icon: 'peoples'
    },
    component: Layout,
    children: [
      {
        path: '/student/pre-student-list',
        name: 'PreStudentList',
        meta: {
          title: '预报名学生列表'
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-pre-student-list" */ '../views/student/PreStudentList/index'
          )
      },
      {
        path: '/student/new-student',
        name: 'NewStudent',
        meta: {
          title: '新增学生'
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-new-student" */ '../views/student/NewStudent/index'
          )
      },
      {
        path: '/student/undivide-classes',
        name: 'UndivideClasses',
        meta: {
          title: '未分班学生列表',
          noCache: false
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-undivide-classes" */ '../views/student/UndivideClasses'
          )
      },
      {
        path: '/student/leave-school-student',
        name: 'LeaveSchoolStudent',
        meta: {
          title: '离校学生'
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-leave-school-student" */ '../views/student/LeaveSchoolStudent/index'
          )
      },
      {
        path: '/student/enrolled-student',
        name: 'EnrolledStudent',
        meta: {
          title: '在册学生'
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-enrolled-student" */ '../views/student/EnrolledStudent/index'
          )
      }
    ]
  },
  {
